        return (
            <div className="wrapper">
                <h1>Delete</h1>
                <ul className="list-group">
                {
                    this.props.list.map((item) => {
                        return (
                            <li className="list-group-item list-group-item-info"   id={item.id}>
                                <div className="itemLi">
                                    <div className="item">
                                        <span>{ item.name } </span>
                                    </div>
                                    <div className="buttons" id={item.id}>
                                        <button id='delete' onClick={this.deleteBtn}>DELETE</button> 
                                    </div>
                                </div>
                            </li>
                        )
                        // return <ListItem key={item.id} item={item} removeBtn={this.removeBtn(this)}/>;

                    })  

                }

            </ul>

            </div>
        )
    }

}

export default Delete
